import './App.css';
import Card from './Components/Card';


import data from "./Components/data";


function App() {
  return (
    <div className="App">

      <div className="cardblock">

          <Card 
          title = {data[0].title}
          imglink = {data[0].imglink}
          info = {data[0].info}
          />

          <Card 
          title = {data[1].title}
          imglink = {data[1].imglink}
          info = {data[1].info}
          />

          <Card 
          title = {data[2].title}
          imglink = {data[2].imglink}
          info = {data[2].info}
          />




      </div>

    </div>
  );
}

export default App;
